define('text!app.html', ['module'], function(module) { module.exports = "<template>\n  <require from=\"styles/app.css\"></require>\n  <require from=\"resources/top-navigation.html\"></require>\n\n  <div class=\"row column content-body\">\n    <top-navigation router.bind=\"router\"></top-navigation>\n    <div class=\"row\">\n      <router-view class=\"column\"></router-view>\n    </div>\n  </div>\n</template>\n"; });
define('text!resources/home.html', ['module'], function(module) { module.exports = "<template>\n  <require from=\"resources/shared/code-block\"></require>\n\n  <h1>Introduction</h1>\n  <p>Example code block:</p>\n  <code-block>export class App {\n  configureRouter(config, router) {\n    this.router = router;\n\n    config.map([\n      {route: '', name: 'introduction', moduleId: 'resources/lessons/introduction', title: 'Introduction', nav: true},\n      {route: 'lesson/setup', name: 'setup', moduleId: 'resources/lessons/setup', title: 'Setup', nav: true}\n    ]);\n  }\n}</code-block>\n</template>"; });
